  \"Lithium-ion Energy Storage at Very Low Temperatures Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T03:43:36.590790\",\n\t\"name\": \"lithium-ion-energy-storage-at-very-low-temperatures-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Li-ion batteries with  specific energy &gt;180
  Wh/kg, calendar life (&gt;15years), and a wide operating temperature range (-60&lt;SUP&gt;o&lt;/SUP&gt;C
  to 60&lt;SUP&gt;o&lt;/SUP&gt;C) are crucial for the deployment of exploration vehicles
  such as rovers, landers, and penetraters as well as for low temperature burst power
  communication. The sub-ambient conductivity and liquid range of present rechargeable
  Li-ion battery electrolytes severely limit low temperature use. Co-solvents freezing
  as low as -132oC and Li salts with highly delocalized anions, enabling high degree
  of ionic dissociation in low dielectric environments provide us with a unique opportunity
  to develop non aqueous electrolytes for the low temperature with ionic conductivities
  well above 10-4 Scm-1.  Our aim is to use these novel electrolytes as a direct substitute
  for the present electrolytes without affecting Li-ion battery performance or life
  during normal operation and access as least half the rated capacity at  -60&lt;SUP&gt;o&lt;/SUP&gt;C
  and 1/2C discharge rate. Working in collaboration with a leading developer of Li-ion
  batteries in Phase I, our low temperature electrolyte formulations will be evaluated
  in Li test cells containing anodes and cathodes used in commercial scale battery
  manufacture. In Phase II, electrolyte composition  will be further optimized and
  prototype batteries will be fabricated and tested for performance.\",\n\t\"license_title\":
